Stufen des Thermomanagements;
Bei Klemme 15 AUS und erkannten Timeout zum Klimabedienteil (z.B. Klimabedienteil während des Motorsteuergeräte-Kommunikations-Nachlaufs bereits im NM-Zustand ¿Bus Sleep¿)
erfolgt keine Ansteuerung der Wasserpumpe durch die ITM Funktion. In dem konkreten Fall wird der definierte Initwert von der ITM-Funktion nicht als Ersatzwert verwendet. Parallel ist eine Ansteuerung zur Restwärmenutzung außerhalb der ITM-Funktion möglich.
